import React from "react";
import N_logo from "../images/N_logo.png";

const Navbar = () => {
    return (
        <nav className="nav_bar georgia navy">
            <div className="ml5">
                <span className="f2">
                    <img src={N_logo} alt="Logo" style={{ maxWidth: "4.8rem", maxHeight: "auto", objectFit: "contain" }} />
                    <span className="ml3 fw6">Know Your Nutrition</span>
                </span>
            </div>
        </nav>
    );
};

export default Navbar;
